import React from "react";

class Header extends React.Component{

    render(){
        return(
            <header>
                <img className='gritPicture' src="https://gritacademy.se/wp-content/uploads/2021/05/Grit-Academy-logo.png" alt='Grid-Academy'/>
            </header>
        )
    }
}

export default Header;
